import React from 'react'
import { useHistory,Link } from 'react-router-dom'


function NavBar() {
    let history= useHistory()
    return (
       
        <div>
            <ul>
                
                <li><Link to="/addflight">ADD</Link></li>
                <li><Link to="/viewflight">VIEW</Link></li>
            </ul>

            
        </div>
    )
}

export default NavBar
